import React from 'react';
import './App.css';
import {ClientCaseManagement} from './components/clientCaseManagement';
import DrRegister from "./components/drRegister";
import ClientRegister from "./components/clientRegister";
import {DrCaseManagement} from "./components/doctorCaseManagement";
import {ClientCaseCreation} from './components/clientCaseCreation'
import {DrOverlay} from './components/drOverlay';
import { ClientOnGoingTable } from './components/clientOnGoingTable';
import {Contact} from './components/testContact';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
function App() {
    /*

              <DrRegister />
              <ClientCaseManagement />
              <ClientRegister />
              <DrCaseManagement />
              <DrOverlay />
              <Contact />

     */

  return (
    <div className="App">

        <div className="App">
            <Router>
                <div className="App">
                    <ul className="App-header">
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/drregister">About Us</Link>
                        </li>
                        <li>
                            <Link to="/contact">Contact Us</Link>
                        </li>
                    </ul>
                    <Switch>
                        <Route exact path='/drRegister' component={DrRegister}></Route>
                        <Route exact path='/drRegister' component={Contact}></Route>
                    </Switch>
                </div>
            </Router>
        </div>
    </div>
  );
}

export default App;
